Every Element in your User Interface will have some sort of properties that the renderer will use when drawing to the screen. These might inform the renderer if the component should be hidden, what its background color should be, or to give it a specific name or ID. To do this, we use the familiar struct-style syntax that Rust provides. Commas are optional: rsx!( div { hidden: true, background_color: "blue", class: "card color-{mycolor}" }
) Each field is defined as a method on the element in the dioxus-html crate. This prevents you from misspelling a field name and lets us provide inline documentation. When you need to use a field not defined as a method, you have two options: file an issue if the attribute should be enabled add a custom attribute on-the-fly To use custom attributes, simply put the attribute name in quotes followed by a colon: rsx!( div { "customAttr": "important data here" }
) Note: the name of the custom attribute must match exactly what you want the renderer to output. All attributes defined as methods in dioxus-html follow the snake_case naming convention. However, they internally translate their snake_case convention to HTML's camelCase convention.

