In short, a component is a special function that takes an input and outputs a group of Elements. Typically, Components serve a single purpose: group functionality of a User Interface. Much like a function encapsulates some specific computation task, a Component encapsulates some specific rendering task. Learning through prior art Let's take a look at a post on r/rust and see if we can sketch out a component representation. Reddit Post This component has a bunch of important information: The score The number of comments How long ago it was posted The url short address The title The username of the original poster If we wanted to sketch out these requirements in Rust, we would start with a struct: struct Post { score: i32, comment_count: u32, post_time: Instant, url: String, title: String, original_poster_name: String
} If we look at the layout of the component, we notice quite a few buttons and functionality: Upvote/Downvote View comments Share Save Hide Give award Report Crosspost Filter by site View article Visit user If we included all this functionality in one rsx! call, it would be huge! Instead, let's break the post down into some core pieces: Post as Component VoteButtons : Upvote/Downvote TitleCard : Title, Filter-By-Url MetaCard : Original Poster, Time Submitted ActionCard : View comments, Share, Save, Hide, Give award, Report, Crosspost Modeling with Dioxus When designing these components, we can start by sketching out the hierarchy using Dioxus. In general, our "Post" component will simply be comprised of our four sub-components. We would start the process by defining our "Post" component. Our component will take in all of the important data we listed above as part of its input. Unlike normal functions, Dioxus components must explicitly define a single struct to contain all the inputs. These are commonly called "Properties" (props). Our component will be a combination of these properties and a function to render them. Our props must implement the Properties trait and - if the component does not borrow any data - PartialEq. Both of these can be done automatically through derive macros: #[derive(Properties, PartialEq)]
struct PostProps { id: Uuid, score: i32, comment_count: u32, post_time: Instant, url: String, title: String, original_poster: String
} And our render function: fn Post((cx, props): Component<PostProps>) -> Element { cx.render(rsx!{ div { class: "post-container" VoteButtons { score: props.score, } TitleCard { title: props.title, url: props.url, } MetaCard { original_poster: props.original_poster, post_time: props.post_time, } ActionCard { post_id: props.id } } })
} When we render components, we use the traditional Rust struct syntax to declare their properties. Dioxus will automatically call "into" on the property fields, cloning when necessary. Notice how our Post component is simply a collection of important smaller components wrapped together in a single container. Let's take a look at the VoteButtons component. For now, we won't include any interactivity - just the rendering the vote buttons and score to the screen. Most of your Components will look exactly like this: a Props struct and a render function. As covered before, we'll build our User Interface with the rsx! macro and HTML tags. However, with components, we must actually "render" our HTML markup. Calling cx.render converts our "lazy" rsx! structure into an Element. Every component must take a tuple of Context and &Props and return an Element. #[derive(PartialEq, Props)]
struct VoteButtonsProps { score: i32
} fn VoteButtons((cx, props): Component<VoteButtonsProps>) -> Element { cx.render(rsx!{ div { class: "votebuttons" div { class: "arrow up" } div { class: "score", "{props.score}"} div { class: "arrow down" } } })
}

