You can avoid clones using borrowed component syntax. For example, let's say we passed the TitleCard title as an &str instead of String. In JavaScript, the string would simply be copied by reference - none of the contents would be copied, but rather the reference to the string's contents are copied. In Rust, this would be similar to calling clone on Rc<str>. Because we're working in Rust, we can choose to either use Rc<str>, clone Title on every re-render of Post, or simply borrow it. In most cases, you'll just want to let Title be cloned. To enable borrowed values for your component, we need to add a lifetime to let the Rust compiler know that the output Element borrows from the component's props. #[derive(Properties)]
struct TitleCardProps<'a> { title: &'a str,
} fn TitleCard<'a>((cx, props): Component<'a, TitleCardProps>) -> Element<'a> { cx.render(rsx!{ h1 { "{props.title}" } })
}

