Though very similar with React, Dioxus is different in a few ways. Most notably, React components will not have a Context parameter in the component declaration. Have you ever wondered how the useState() call works in React without a this object to actually store the state? React uses global variables to store this information which must be carefully managed, especially in environments with multiple React roots - like the server. function Component({}) { let [state, set_state] = useState(10);
} Because Dioxus needs to work with the rules of Rust, we need to provide a way for the component to do some internal bookkeeping. That's what the Context object is: a place for the component to store state, manage listeners, and allocate elements. Advanced users of Dioxus will want to learn how to properly leverage the Context object to build robust, performant extensions for Dioxus. fn Post((cx /* <-- our Context object*/, props): Component<PostProps>) -> Element { cx.render(rsx!{ })
}

