Every user interface you've ever used is just a symphony of tiny widgets working together to abstract over larger complex functions. In Dioxus, we call these tiny widgets "Elements." Using Components, you can easily compose Elements into larger groups to form even larger structures: Apps. Because Dioxus is mostly used with HTML/CSS renderers, the default Element "collection" is HTML. Provided the html feature is not disabled, we can declare Elements using the rsx! macro: #use dioxus::prelude::*;
rsx!( div {}
) As you might expect, we can render this call using Dioxus-SSR to produce valid HTML: #use dioxus::prelude::*;
dioxus::ssr::render_lazy(rsx!( div {}
)) Produces: <div></div> We can construct any valid HTML tag with the tag {} pattern and expect the resulting HTML structure to resemble our declaration.

