Of course, we need more complex structures to make our apps actually useful! Just like HTML, the rsx! macro lets us nest Elements inside of each other. #use dioxus::prelude::*;
rsx!( div { h1 {} h2 {} p {} }
) As you might expect, the generated HTML for this structure would look like: <div> <h1></h1> <h2></h2> <p></p>
</div> With the default configuration, any Element defined within the dioxus-html crate can be declared in this way. To create your own new elements, see the Custom Elements Advanced Guide.

