Dioxus also supports a special type of Element: Text. Text Elements do not accept children, but rather just string literals denoted with double quotes. rsx! ( "hello world"
) Text Elements can be composed within other Elements: rsx! ( div { h1 { "hello world" } p { "Some body content" } }
) Text can also be formatted with any value that implements Display. We use f-string formatting - a "coming soon" feature for stable Rust that is familiar for Python and JavaScript users: let name = "Bob";
rsx! ( "hello {name}" ) Unfortunately, you cannot drop in arbitrary expressions directly into the string literal. In the cases where we need to compute a complex value, we'll want to use format_args! directly. Due to specifics of how the rsx! macro (we'll cover later), our call to format_args must be contained within curly braces and square braces. rsx!( {[format_args!("Hello {}", if enabled { "Jack" } else { "Bob" } )]} ) This is different from React's way of generating arbitrary markup but fits within idiomatic Rust. Typically, with Dioxus, you'll just want to compute your substrings outside of the rsx! call: let name = if enabled { "Jack" } else { "Bob" };
rsx! ( "hello {name}" )
